export const myReduser =(name ={res : 'ayman'} , action) =>{
  if(action.type === 'f'){
    return {res : 'aymanrrrr'}
  }
  if(action.type === 's'){
    return {res : name.res + 'muga'}
  }
  if(action.type === 'l'){
    return {res : name.res + 'alao'}
  }
  return name
}
